import React from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js"; // for dropdowns and other JS components
import Header from "./components/Header";
import Posts from "./components/Posts";
import Page from './components/Page'; // Import the Page component

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
  <Route path="/" element={<Page slug="home" />} />
  <Route path="/about" element={<Page slug="about" />} />
  <Route path="/contact" element={<Page slug="contact" />} />
</Routes>
      <Posts/>
    </Router>
  );
};

export default App;
